Now let me design the Dexie.js schema for our todo app data model:

**Dexie.js Schema Design for Todo App:**

Based on our requirements, here's the IndexedDB schema design:

```typescript
// Database Schema
interface TodoItem {
  id?: number;           // Auto-increment primary key
  text: string;          // Todo text content
  completed: boolean;    // Completion status
  priority: 'low' | 'medium' | 'high' | 'critical';
  dueDate?: string;      // ISO date string (optional)
  createdAt: Date;       // Creation timestamp
  updatedAt: Date;       // Last update timestamp
}

interface Tag {
  id?: number;           // Auto-increment primary key
  name: string;          // Tag name (unique)
  color: string;         // Hex color code for tag display
  createdAt: Date;       // Creation timestamp
}

interface ItemTag {
  id?: number;           // Auto-increment primary key
  itemId: number;        // Foreign key to TodoItem
  tagId: number;         // Foreign key to Tag
}

// Dexie Database Definition
class TodoDatabase extends Dexie {
  items!: Table<TodoItem>;
  tags!: Table<Tag>;
  itemTags!: Table<ItemTag>;

  constructor() {
    super('TodoDatabase');
    this.version(1).stores({
      items: '++id, text, completed, priority, dueDate, createdAt, updatedAt',
      tags: '++id, &name, color, createdAt', // &name = unique index
      itemTags: '++id, itemId, tagId, [itemId+tagId]' // compound index
    });
  }
}
```

**Vue 3 + Pinia Integration Pattern:**

```typescript
// Pinia Store Structure
interface TodoState {
  items: TodoItem[];
  tags: Tag[];
  filter: 'all' | 'active' | 'completed';
  selectedTags: number[];
  loading: boolean;
}

// Store Actions
- loadItems()
- addItem(item: Omit<TodoItem, 'id' | 'createdAt' | 'updatedAt'>)
- updateItem(id: number, updates: Partial<TodoItem>)
- deleteItem(id: number)
- toggleComplete(id: number)
- loadTags()
- addTag(tag: Omit<Tag, 'id' | 'createdAt'>)
- deleteTag(id: number)
- addTagToItem(itemId: number, tagId: number)
- removeTagFromItem(itemId: number, tagId: number)
```

