import { defineStore } from 'pinia'
import { ref, computed } from 'vue'
import type { TodoItem, Tag, FilterType, Priority } from '@/types/todo'
import { todoService } from '@/services/todoService'
import { initializeDatabase } from '@/services/database'

export const useTodoStore = defineStore('todo', () => {
  // State
  const todos = ref<TodoItem[]>([])
  const tags = ref<Tag[]>([])
  const filter = ref<FilterType>('all')
  const selectedTags = ref<number[]>([])
  const loading = ref(false)
  const error = ref<string | null>(null)

  // Getters
  const filteredTodos = computed(() => {
    let filtered = todos.value

    // Filter by completion status
    if (filter.value === 'active') {
      filtered = filtered.filter(t => !t.completed)
    } else if (filter.value === 'completed') {
      filtered = filtered.filter(t => t.completed)
    }

    // Filter by selected tags
    if (selectedTags.value.length > 0) {
      filtered = filtered.filter(async todo => {
        const todoTags = await todoService.getTodoTags(todo.id!)
        return selectedTags.value.some(tagId => 
          todoTags.some(tag => tag.id === tagId)
        )
      })
    }

    return filtered.sort((a, b) => b.createdAt.getTime() - a.createdAt.getTime())
  })

  const todoStats = computed(() => ({
    total: todos.value.length,
    active: todos.value.filter(t => !t.completed).length,
    completed: todos.value.filter(t => t.completed).length
  }))

  // Actions
  async function initialize() {
    try {
      loading.value = true
      error.value = null

      await initializeDatabase()
      await loadTodos()
      await loadTags()
    } catch (err) {
